import React from 'react';
import {Link} from 'react-router-dom';
import './Centers.css';

//아마 여기다가 작성하면 될 듯함.

function DetailItem(props) {
  return (
      <>
        <li >
          <div>
              <figure data-category={props.label}>
              
                    <img
                    alt=''
                    src={props.src}
                    />
              
              </figure>
              </div>
              <div>
                  <h4>{props.text}</h4>
                  <h5>{props.text2}</h5>
                  <h6>{props.label}</h6>
                  <hr></hr>
              </div>
        </li>
      </>
  );
}

export default DetailItem;
